import React from 'react';
import house_bg from './img/house_bg.jpg';
import business_bg from './img/business_bg.jpg';
import farmy_bg from './img/farmy_bg.jpg';

const Offer = () => {
  return (
    <div className="main__section">
      <div className="container">
        <h2>Oferta</h2>
        <div className="offers">
          <div className="home">
            <img src={house_bg} alt="house" />
            <h3>Dla domu</h3>
            <p></p>
          </div>
          <div className="business">
            <img />
            <h3>Dla biznesu</h3>
            <p></p>
          </div>
          <div className="farmy">
            <img />
            <h3>Farmy PV</h3>
            <p></p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Offer;
